import styled from "styled-components";

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
`

export const FormContainer = styled.form`
    padding: 20px;
    background-color: rgb(248, 248, 238);
    border-radius: 5px;
`
